import React from 'react';
import {Link} from 'react-router-dom';
import './BookDisplay.css';
import cchcover from './cchcover.jpg';

function FeaturedBook(props) {
    return (
        <>
            {/* <h1 className='display'>Book Display</h1> */}
            <ul display="inline" >
                <Link to={props.path} >
                    <li display="inline" >
                    <figure  data-category={props.label}>
                        <img src={props.src} width="10" alt="Cross Country Hearts"
                        />
                    </figure>
                    </li>
                    <li display="inline">
                    <div >
                        <h5 >{props.text}</h5>
                    </div>
                    </li>
                </Link>
            </ul>
        </>
    )
}

export default FeaturedBook;
